import './App.css';
import Card from './Card';

function App() {
  const [counter, setCounter] = useState(0);

  return (
    <div>
      <div>
        <h1>React Testanwendung</h1>
        <h2>HouseTech</h2>
      </div>
      <div className="content">
        <div>
          <button onClick={setCounter(counter+1)}>Klick mich!</button>
        </div>
        <div id="card-container"></div>
      </div>
    </div>
  );
}

export default App;
